//Import Images

export const GetInTouchHeaderData = () => {
  return [
    {
      id: 1,
      title: "Tell us about your project",
      description:
        "We have put a number of corporate brands into  a better market position simply by the revamping them.",
      button_text: "Get in touch",
    },
    {
      id: 2,
      title: "Join our team",
      description:
        "Join our team of creative minds and build working products. Own your work and don’t be afraid to display it.",
      button_text: "View open positions",
    },
  ];
};
